def generate_multiples(factor, count):
    multiples = []

    for i in range(1, count + 1):
        multiples.append(factor * i)

    return multiples

if __name__ == "__main__":
    factor = int(input())
    count = int(input())

    result = generate_multiples(factor, count)
    print(result)

